DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_1`(
         in in_rid int ,
         out out_title varchar(255) 
)
begin 

         set @title := "";
         select *
         from article
         where rootid = in_rid;
         
         select title into @title
         from article
         where id = in_rid;
         set out_title := @title;

end//
DELIMITER ;

